import { useState } from "react";
import "./pomodoro.css";
// import React, { useState, useEffect } from "react";

function Pomodoro() {
  let [stopwatch, setStopwatch] = useState(120);
  function StopwatchStart() {
    if ((stopwatch) => 0) {
      return <span>KONIEC</span>;
    } else {
      return <span>{stopwatch}</span>;
    }

    return (
      <div className="Pomodoro">
        <div className="pomodoroCounter">
          <StopwatchStart />
        </div>
        <button className="pomodoroButton">START</button>
      </div>
    );
  }
}

export default Pomodoro;
